def render_step_progress(current_step: int):
    """
    Draw a 4segment progress bar,
    marking completed steps with , the current step with ,
    and future steps in grey.
    """
    labels = ["Step1","Step2","Step3","ResultsCanvas"]
    html = ['<div style="display:flex; margin-bottom:1rem;">']
    for i, label in enumerate(labels):
        if i < current_step - 1:
            icon = ""
            color = "#2c3e50"
        elif i == current_step - 1:
            icon = ""
            color = "#f39c12"
        else:
            icon = ""
            color = "#aaa"
        html.append(
            f'''<div style="
                    flex:1;
                    text-align:center;
                    padding:0.5rem;
                    border-bottom:3px solid {color};
                    color:{color};
                    font-weight:bold;
                ">
                  {icon}{label}
               </div>'''
        )
    html.append("</div>")
    st.markdown("".join(html), unsafe_allow_html=True)

